// src/pages/DashboardHomePage.jsx
import React from 'react';

const DashboardHomePage = () => {
    return (
        <div style={{ padding: '20px', textAlign: 'center' }}>
            <h2>Dashboard Home Page</h2>
            <p>This is a placeholder for your Dashboard Home content (HR/Manager).</p>
            <p>You can start building your dashboard features here.</p>
        </div>
    );
};

export default DashboardHomePage;
